import React from "react";
import Header from "./header";
import Footer from "./footer";
import Note from "./Note.jsx";
import notes from "../notes";



function App(){
    return <div>
        <Header />
        {notes.map((noteItem) => {
    return <Note 
    key={noteItem.key}
    title={noteItem.title}
    content={noteItem.content}
    />

}
            
        )};
        <Footer />
    </div>
}

export default App;
